 time: 26078.55 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 83.53 s &lt;/li&gt;\n&lt;li&gt; disk-read time: 63.53 ms &lt;/li&gt;\n&lt;li&gt; transfer time: 1866.12 s &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.10.216:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 32 &lt;/li&gt;\n          &lt;li&gt; Threads: 768 &lt;/li&gt;\n          &lt;li&gt; Memory: 5.40 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport h5py\nimport os\nimport dask.array as da\nimport time\nfrom dask.distributed import performance_report, Client\nimport json \nimport yaml\n\n#Scheduler file name and configuration file\nscheduler_info = 'scheduler.json'\nconfig_file = 'config.yml'\n\ndef connect(sched_file):\n    with open(sched_file) as f:\n        s = json.load(f)\n    adr = s[\"address\"]\n    try:\n        client  = Client(adr, timeout=60, heartbeat_interval=10)\n        print(\"client connected\", flush=True)\n    except Exception as e:\n        print(\"retrying ...\", flush=True)\n        client = Client(adr, timeout=60, heartbeat_interval=10)\n    return client\n\n\nwith open(config_file) as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    chun= data[\"chunks\"]\n\nchuny=int(chun[\"width\"])\nchunx=int(chun[\"height\"])\nprint(\"chunks\", chunx, chuny)\n\n# Get client\nclient = connect(scheduler_info)\n\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\nwith performance_report(filename=\"dask-report.html\"): \n    t = time.time()\n    f = h5py.File('data.h5', 'r') \n    d = f['local_t']\n    print(d, flush=True)\n    gt = da.from_array(d, chunks=(1,chunx,chuny))\n    # Construct a lazy task graph \n    print(\"gt array\", gt, flush=True)\n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n    # Submit the task graph to the scheduler\n    s = client.persist(cpt)\n    print(\"result \", client.compute(s).result(), flush=True)       \n\nprint(\"Done in \", time.time() - t, flush=True)\nos.remove('data.h5') \nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1118","type":"LinearScale"},{"attributes":{"factors":["tcp://172.21.10.219:45725","tcp://172.21.10.219:46265","tcp://172.21.10.220:37570","tcp://172.21.10.220:44008","tcp://172.21.10.221:40843","tcp://172.21.10.221:46442","tcp://172.21.10.222:37142","tcp://172.21.10.222:38821","tcp://172.21.10.223:37635","tcp://172.21.10.223:39301","tcp://172.21.10.224:37632","tcp://172.21.10.224:46484","tcp://172.21.10.225:36636","tcp://172.21.10.225:45207","tcp://172.21.10.226:37625","tcp://172.21.10.226:43759","tcp://172.21.10.227:35436","tcp://172.21.10.227:44617","tcp://172.21.10.228:34174","tcp://172.21.10.228:45956","tcp://172.21.10.229:39525","tcp://172.21.10.229:39736","tcp://172.21.10.230:36171","tcp://172.21.10.230:46506","tcp://172.21.10.231:33908","tcp://172.21.10.231:36799","tcp://172.21.10.232:34575","tcp://172.21.10.232:39774","tcp://172.21.10.234:35449","tcp://172.21.10.234:38785","tcp://172.21.10.235:37020","tcp://172.21.10.235:39413"]},"id":"1155","type":"FactorRange"},{"attributes":{"bottom":{"field":"bottom"},"fill_color":{"field":"color"},"hatch_color":{"field":"color"},"left":{"field":"left"},"line_width":{"value":2},"right":{"field":"right"},"top":{"field":"top"}},"id":"1067","type":"Quad"},{"attributes":{"num_minor_ticks":5,"tickers":[{"id":"1460"},{"id":"1461"},{"id":"1462"},{"id":"1463"},{"id":"1464"},{"id":"1465"},{"id":"1466"},{"id":"
